import React from 'react';
import "../App.css";

function AboutCard (props) {
    return (
        <div className='AboutCard'>
            <h1>{props.title}</h1>
            <h2>{props.role}</h2>
            <h3>{props.timeframe}</h3>
            <img src={props.image} alt={props.title}/>
            <ul>
                {/* {{bullets}.map((bullet) => <li>{bullet}</li>
                } */}
            </ul>
        </div>
    );
}


export default AboutCard;
